import './App.css';
import { ThemeProvider } from '@mui/material/styles';
import Banner from './Banner'
import theme from './theme'

function App() {
  return (
    <ThemeProvider theme={theme}>
      <div className="App">
        <Banner/>
      </div>
    </ThemeProvider>
  );
}

export default App;
